export class HeaderDescriptionHtmlBox{constructor(){let t="/PageComponents/"+this.constructor.name,n=document.createElement("link");n.setAttribute("rel","stylesheet");n.setAttribute("href",t+"/style.min.css");document.head.append(n)}InsertAdjacentHTML(n,t,i){let r='<div id="'+this.constructor.name+'"><p>'+i+"<\/p><\/div>";n.insertAdjacentHTML(t,r)}}